INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1001, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "春咲 ひより", 2, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 0, 1.4, 0, 1, "お！\nあそこに困ってそうな人発見！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1002, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "草野 優衣", 2, "みんなみたいに\nわたしも強くならなきゃ", 0, 1, 0, 1.4, 0, 1, "大切な人を\n守れるようになりたい…って", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1003, 1, "少しは磨かれると思いますよ。", 0, "士条 怜", 2, "フェンシングを始めてみては？", 0, 1, 0, 1.4, 0, 1, "キミに必要な集中力と感性が", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1004, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "穂高 みそぎ", 2, "ねぇ、にいちゃん！", 0, 1, 0, 1.5, 0, 1, "今日はなにして遊ぶ？", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1006, 1, "私といっしょに…\nいかない？", 0, "風宮 あかり", 2, "風宮あかりです", 0, 1, 0, 1.4, 0, 1, "ねぇ…", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1007, 1, "食べ物の恨みは怖いのー", 0, "出雲 宮子", 2, "出雲宮子なのー", 0, 1, 0, 1.5, 0, 1, "プリンたべたいのー", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1008, 1, "いいよ。\n見られることは運命さ…", 0, "虹村 雪", 2, "ボクは虹村雪。", 0, 1, 0, 1.4, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1009, 1, "人呼んで「疾風の冥姫」!!", 0, "柊杏奈", 2, "フッ…聞いて後悔するがいい！", 0, 1, 0, 1.4, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1010, 1, "ほんまおおきにやわ～♪", 0, "姫宮 真歩", 2, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, 0, 1.5, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1011, 1, "ここで会ったが\n100年目～！", 0, "衣之咲 璃乃", 2, "衣之咲璃乃です！", 0, 1, 0, 1.4, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1012, 1, "…って、お願い！\n誰にも言わないでおいて～！", 0, "柏崎 初音", 2, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, 0, 1.4, 0, 1, "ち、超能力って…\n何のことかな～？", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1016, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "美波 鈴奈", 2, "ちょす！\n美波鈴奈だよ～♪", 0, 1, 0, 1.4, 0, 1, "一応カリスマ読モJKやってまっす！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1017, 1, "でも、沖縄もとってもいいとこさー", 0, "喜屋武 香織", 2, "はいたーい。\n喜屋武香織さー。", 0, 1, 0, 1.4, 0, 1, "東京は遊園地みたいなところさー", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1018, 1, "イオちゃんって呼んでね。", 0, "支倉 伊緒", 2, "支倉伊緒です。", 0, 1, 0, 1.4, 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1020, 1, "ミミをおいてかないでぇ～", 0, "茜 ミミ", 2, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, 0, 1.5, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1021, 1, "ふぇぇぇぇぇん……", 0, "栗林 くるみ", 2, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, 0, 1.5, 0, 1, "あの……\nふぇ……", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1022, 1, "なんてありがとうございます！", 0, "風宮 より", 2, "風宮よりです。\nあああああ！", 0, 1, 0, 1.4, 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1023, 1, "私こっち行きたいー\nね、早く早くー", 0, "北条 綾音", 2, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, 0, 1.5, 0, 1, "おにいちゃんどこいくの？\nえ？", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1025, 1, "これて何か違う…\nあああすみません！", 0, "天野 すずめ", 2, "わっ…わっ…私、\n天野すずめといいます！", 0, 1, 0, 1.4, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1027, 1, "離しませんわ………\n絶対に…!!", 0, "倉石 恵理子", 2, "……クスクス…私は\n…倉石恵理子……", 0, 1, 0, 1.4, 0, 1, "あなたは…運命の……\n伴侶……", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1028, 1, "…そうでしょ？？", 0, "佐々木 咲恋", 2, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, 0, 1.4, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1029, 1, "あはは、\n私もまだまだだなぁ～", 0, "桜井 望", 2, "桜井望だよ！\nよろしくねっ", 0, 1, 0, 1.4, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1030, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "ニノン・ジュベール", 2, "デケデケデンっ！", 0, 1, 0, 1.4, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1031, 1, "おかしいですね……", 0, "上喜 しのぶ", 2, "上喜しのぶです。\n手元のドクロが父です。", 0, 1, 0, 1.4, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1033, 1, "そう、\nオラのボケに突っ込める相方が…！", 0, "野戸まひる", 2, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, 0, 1.5, 0, 1, "けんども\nそれには足りないモンが…", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1034, 1, "ちょ\nちょっと一杯飲んできます…！", 0, "綾瀬 ゆかり", 2, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, 0, 1.4, 0, 1, "ちょっと緊張しちゃって…", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1036, 1, "これ以上お話しすることは…\nないです！", 0, "氷川 鏡華", 2, "氷川鏡華…です", 0, 1, 0, 1.5, 0, 1, "知らない人とは話しちゃいけないので", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1038, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "柏崎 栞", 2, "柏崎…栞です。", 0, 1, 0, 1.4, 0, 1, "……あ、アラーム。", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1040, 1, "野に咲く花が、\n唯一の話相手です。", 0, "双葉 碧", 2, "ふ、双葉碧です。", 0, 1, 0, 1.4, 0, 1, "私、一人も友達がいなくて……", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1042, 1, "そう思っています。", 0, "三角 千歌", 2, "三角千歌です。", 0, 1, 0, 1.4, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1043, 1, "う、疑ってすまなかったな…", 0, "安芸 真琴", 2, "安芸真琴だ。", 0, 1, 0, 1.4, 0, 1, "あぁ？\nお前のそいつの仲間か？", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1044, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "イリヤ・オーンスタイン", 2, "わらわこそは夜を総べる者！", 0, 1, 0, 1.4, 0, 1, "生けとし生ける全ての者よ！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1045, 1, "ｌク、クウカに何かご用ですか!?", 0, "遠見 空花", 2, "そこで騎士は妖精を乱暴に……", 0, 1, 0, 1.4, 0, 1, "ぐふふふふ……はっ！", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1046, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "宮坂たまき", 2, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, 0, 1.4, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1048, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "大神 美冬", 2, "大神美冬よ！", 0, 1, 0, 1.4, 0, 1, "それでは早速クエストに…", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1049, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "星野静流", 2, "星野静流だよ！", 0, 1, 0, 1.4, 0, 1, "クエストもバトルも\n掃除も洗濯も", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1050, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "玉泉美咲", 2, "アタシは玉泉美咲。", 0, 1, 0, 1.5, 0, 1, "見ての通りの\nセクシー美少女で", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1052, 1, "？？？？", 0, "リマ", 2, "？？？", 0, 1, 0, 1.4, 0, 1, "？？？？", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1053, 1, "そ、そこまでいうなら\nもらってやる", 0, "モニカ・ヴァイスヴィント", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1058, 1, "そ、そこまでいうなら\nもらってやる", 0, "ペコリーヌ", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1059, 1, "そ、そこまでいうなら\nもらってやる", 0, "コッコロ", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1060, 1, "そ、そこまでいうなら\nもらってやる", 0, "キャル", 2, "モニカ・ヴァイスヴィントだ。", 0, 1, 0, 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0);
